function w_PPT = PPT_fast(E_field_list, lambda, nameAtom, cycleAveraging, approx_or_exact)
% This code is optimized for speed, hence why it doesn't have many
% functions, and that all variables are defined only locally and all the
% things which could be pre-compute have been pre-computed.
%
% Reminder: from I_peak (W/m^2) to E_peak (V/m):
%           E_peak = sqrt(753.460626923542 * I_peak)
%
% Source: https://journals.aps.org/pra/abstract/10.1103/PhysRevA.96.063417
%
% Inputs: - E_field_list: Electric field in SI (V/m), can be one element
%               or a list
%         - lambda: Wavelength in meters
%         - nameAtom: 'He', 'Ne', 'Ar', 'Kr', 'Xe', and some of their ions
%               (see code to see which ones)
%         - cycleAveraging: Boolean, to apply or not cycle averaging
%               (correct way is with, if time dependence is needed,
%               consider using the Yudin-Ivanov code)
%         - approx_or_exact: 'approx' or 'exact', for the calculation of
%               the Dawson integral. Approx is MUCH faster, but creates
%               some small numerical artefacts in the P_nl calculation at
%               high energies. Should be used by default, but not for
%               publications
%
% Output: - w_PPT: Ionizations / second (could be > 1). To get ionization
% probability : P = 1 - exp(-trapz(list_time, w_PPT_at_fixed_I)), with a
% new peak intensity at every peak intensity the ionization probability
% needs to be computed
%
% IMPORTANT PHYSICAL NOTES:
%       - The number of photons needed before ionization is now set to what
%           was in the paper ((Up+Ip)/omega)
%       - The pre-factor sqrt(3*nStar^3/pi) is missing in the Lai2017
%           paper, but should be there (present in all other papers, and
%           accounts for cycle-averaging)
%       - nStar is defined as 1/sqrt(2*Ip) in the Lai2017 paper. However,
%           it was shown that it can be generalized to Zc/sqrt(Ip), so I
%           implemented it that way (to allow multiply-ionized studies).
%           This is ok to do so: https://doi.org/10.1103/PhysRevA.93.023413
%       - l and m are orbital and magnetic quantum numbers, respectively.
%           The spin doesn't matter here. Though, from Hund's rule, one
%           would expect to have m=0,-1,1,0,-1,1 and not 0, 0, 1, 1, 1, 1
%           (for increasingly ionized states). However, the PPT guys showed
%           that the m=0 state is ionized first, hence why it's in that
%           order (also shown in
%           Strong_field_laser_physics_10.1007_978-0-387-34755-4 page 121)
%       - Conversion from eV to atomic units: divide the eVs by 27.211
%       - The factor n^8 in the c_nl in the paper is wrong, it's supposed
%           to be nStar (checked with other papers)
%       - All m numbers are written without the abs value since I wrote all
%           the m numbers to be directly positive.
%       - The Coulomb correction from 10.1103/PhysRevLett.101.193003 is
%           just an higher order term from the Coulomn expansion. So, the
%           (2/F)^(2*nStar) was already included in the original PPT paper.
%           Also, in the Lai2017 paper, they mention multiple times the
%           (2/F)^(2*nStar) as being the long-range Coulomb factor. This
%           misses the -abs(m)-1 (checked not to work properly otherwise).
%           It's in the formula (A2), but it's not in the main text, maybe
%           for easiness to read? Anyways, it was shown that the
%           -abs(m)-1 term doesn't apply on this higher order term
%           (10.1103/PhysRevA.93.023413).
%
% IMPLEMENTATION NOTES:
%       - In order to make the computation faster, I pre-computed some
%           tables of w_m(x) (Dawson integral). In order to load those
%           tables faster, the tables are loaded into the memory the first
%           time the code is executed, and afterwards the tables are kept
%           in memory. This is done through the use of persistent types
%           (creates some hidden pointers which are kept in memory). Matlab
%           will never clear this memory unless you tell it to do so:
%              munlock('PPT_fast'); clear numberExecutionsPPT_fast;
%              clear dawson0; clear dawson1;
%           IT IS ABSOLUTELY NECESSARY TO EXECUTE THOSE INSTRUCTIONS BEFORE
%           MODIFYING ANYTHING IN THE FUNCTION (MATLAB WON'T SEE ANY
%           MODIFICATION TO THIS FUNCTION BEFORE THIS IS EXECUTED)
%       - To access the pre-computed values of the Dawson integral, I
%           created a table of log spaced numbers, and the 
%           "round((log10(x)+50)*1000), 2)'" is there only to find the
%           right number directly in the table, without interpolating (it
%           would be slower).
%
% Example:
%     tau_FWHM        = 10e-15;
%     time_list       = linspace(-2*tau_FWHM, 2*tau_FWHM, 1000);
%     lambda          = 800e-9;
%     atom            = 'He';
%     I_peak          = 2e15*1e4;
%     f_t             = functionGenerator(time_list, tau_FWHM, 0, 'Gaussian'); % To be scaled later in W/m^2
%     I_field         = I_peak * f_t;
%     CEP             = 0;
%     E_field         = sqrt(753.460626923542 * I_peak * f_t).* cos(2*pi*299792458/lambda*time_list + CEP);
%     E_field_CA      = sqrt(753.460626923542 * I_peak * f_t);
%     E_max           = sqrt(753.460626923542 * I_peak); % Don't take max(E_field)! If CEP ~= 0, this will lead to wrong results!
%     w_YI                = PPT_Yudin_Ivanov(E_max, lambda, atom, time_list, CEP, sqrt(f_t), 'approx');
%     w_PPT               = PPT_fast(E_field, lambda, atom, 0, 'approx');
%     w_PPT_CA            = PPT_fast(E_field_CA, lambda, atom, 1, 'approx');
%     w_ADK               = ADK_fast(E_field, atom, 0);
%     w_ADK_BSI           = ADK_fast(E_field, atom, 1);
%     Ion_prob_YI         = 1 - exp(-cumtrapz(time_list, w_YI));
%     Ion_prob_PPT        = 1 - exp(-cumtrapz(time_list, w_PPT));
%     Ion_prob_PPT_CA     = 1 - exp(-cumtrapz(time_list, w_PPT_CA));
%     Ion_prob_ADK        = 1 - exp(-cumtrapz(time_list, w_ADK));
%     Ion_prob_ADK_BSI    = 1 - exp(-cumtrapz(time_list, w_ADK_BSI));
%     yyaxis left
%       plot(time_list * 1e15, Ion_prob_PPT*100, '-', 'color', [0 0.4470 0.7410])
%       hold on
%       plot(time_list * 1e15, Ion_prob_PPT_CA*100, '-', 'color', [0.9290 0.6940 0.1250])
%       plot(time_list * 1e15, Ion_prob_YI*100, '--', 'color', [0.4940 0.1840 0.5560])
%       plot(time_list * 1e15, Ion_prob_ADK*100, '-', 'color', [0.4660 0.6740 0.1880])
%       plot(time_list * 1e15, Ion_prob_ADK_BSI*100, '-', 'color', [0.3010 0.7450 0.9330])
%       hold off
%       ylabel('Ionization probability (%)')
%       grid on
%     yyaxis right
%       plot(time_list * 1e15, E_field * 1e-10)
%       xlim([time_list(1) time_list(end)]*1e15)
%       ylabel('Electric field (10^{10} V/m)')
%       legend({'PPT', 'PPT CA', 'Yudin-Ivanov', 'ADK', 'ADK BSI corrected', 'Electric field'}, ...
%           'interpreter', 'none', 'location', 'northwest')
%     title(['Ionization probability calculation in ', atom, ' with \lambda=', ...
%       num2str(lambda*1e9), ' nm, I_{peak}=', num2str(I_peak*1e-12*1e-4), ' TW.cm^{-2} and {\tau}_{FWHM}=', ...
%       num2str(tau_FWHM*1e15), ' fs'])
%     makeItNice('screenNumber', 2)
%
% Adding new material:
%     clc
%     w_PPT       = PPT_fast('Xe2', 1e14, 800e-9); %  [Ip, Z_c, l, m]; From eV to a.u., divide by 27.2114
%     Ip          = w_PPT(1);
%     Z_c         = w_PPT(2);
%     l           = w_PPT(3);
%     m           = w_PPT(4);
%     nStar       = Z_c/sqrt(2*Ip);
%     lStar       = nStar - 1;
%     c_nl        = 2^(2*nStar) / (nStar * gamma(nStar + lStar + 1) * gamma(nStar - lStar));
%     f_lm        = (2*l+1) * factorial(l+m) / (2^m * factorial(m) * factorial(l-m));
%     exp_gamma2  = m/2 + 3/4;
%     pref_g_exp  = - 2 * (2*Ip)^(3/2) / 3;
%     kappa_3     = sqrt(2*Ip)^3;
%     disp(' ')
%     disp(['        nStar           = ', num2str(nStar, '%4.10f'),'; % Z_c/sqrt(2*Ip)']);
%     disp(['        lStar           = ', num2str(lStar, '%4.10f'),'; % nStar - 1']);
%     disp(['        c_nl            = ', num2str(c_nl, '%4.10f'),'; % 2^(2*nStar) / (nStar * gamma(nStar + lStar + 1) * gamma(nStar - lStar))']);
%     disp(['        f_lm            = ', num2str(f_lm, '%4.10f'),'; % (2*l+1) * factorial(l+m) / (2^m * factorial(m) * factorial(l-m))']);
%     disp(['        exp_gamma2      = ', num2str(exp_gamma2, '%4.10f'),'; % m/2 + 3/4']);
%     disp(['        pref_g_exp      = ', num2str(pref_g_exp, '%4.10f'),'; % - 2 * (2*Ip)^(3/2) / 3']);
%     disp(['        kappa_3         = ', num2str(kappa_3, '%4.10f'),'; % kappa_3 = sqrt(2*Ip)^3']);
%
% Date: 21.01.2021
%
% Author: Pierre-Alexis Chevreuil (chpierre@phys.ethz.ch), based on a
% previous version from Justinas Pupeikis, Benjamin Willenberg and
% Francesco Saltarelli (code completely re-written from scratch to optimize
