nStar       = Z_c / sqrt(2 * Ip);
lStar       = nStar - 1;
c_nl        = 2^(2 * nStar) / (nStar * gamma(nStar + lStar + 1) * gamma(nStar - lStar));
f_lm        = (2 * l + 1) * factorial(l+m) / (2^m * factorial(m) * factorial(l-m));
exp_gamma2  = m/2 + 3/4;
pref_g_exp  = - 2 * (2 * Ip)^1.5 / 3;
F_0         = abs(E_field_list) / 5.14220674763e11; % From V/m to atomic units
omega       = 2 * pi * 299792458 * 2.4188843265857e-17 / lambda; % 2*pi*2.4188843265857e-17 to go from rad/s to atomic units, should be 0.057 for 800 nm
Up          = F_0.^2 / (4*omega^2); % Ponderomotive energy in atomic units
kGamma      = omega .* sqrt(2 * Ip) ./ F_0; % Keldysh (not gamma not to confuse with the gamma function)
beta        = 2 * kGamma ./ sqrt(1 + kGamma.^2);
alpha       = 2 * (asinh(kGamma) - kGamma ./ sqrt(1 + kGamma.^2)); % Also called c1 (just a factor of 2 difference) in Popruzhenko2008
q_min       = (Ip + Up) / omega; % Minimum number of photons required to reach the effective ionization threshold Ip + Up to infinity
q_min_c     = ceil(q_min);
nu          = Ip / omega * ( 1 + 1 ./ (2*kGamma.^2)); % Ionization threshold (in photons), also called n_th in the original PPT paper
nu_ceil     = ceil(nu + 10 ./ alpha); % The 10 / alpha adds some iterations the more gamma decreases. The 10 was determined empirically by looking at the ion. probability curve and see when it stopped moving the more iterations were added.
gGamma      = (3./(2*kGamma)) .* ( (1 + 1./(2*kGamma.^2)) .* asinh(kGamma) - sqrt(1 + kGamma.^2) ./ (2*kGamma)); % g(gamma)
CC_base     = (2 ./ F_0 ./ nStar^3).^(2*nStar - m - 1); % Original long range Coulomb correction, from the original PPT paper 
CC_ext      = (1 + 2 * exp(-1) * kGamma).^(-2 * nStar); % Coulomb correction from Popruzhenko2008_Coulomb_correction_PPT_10.1103_PhysRevLett.101.193003, higher order term compared to the original PPT paper
CC          = CC_base .* CC_ext; % Overall Coulomb correction
if cycleAveraging, CA = sqrt(3*F_0 * nStar^3 / pi); else, CA = 1; end % Cycle averaging, forgotten in the Lai2017 paper, but always here (from original PPT paper)
w_m_sum = zeros(1, length(kGamma));

for k = 1 : length(kGamma)
    n  = (0:nu_ceil(k)) + q_min_c(k); % Number of photons above the Ip+Up barrier (each n is one photon and the overall w_ppt is the sum of the individual w_ppt for n-photon ionization)
    xDawson = sqrt(beta(k).*(n - q_min(k)));
    if strcmp(approx_or_exact, 'exact')
        yDawson = zeros(1, length(xDawson));
%         parfor i = 1 : length(yDawson)
%             yDawson(1, i) = integral(@(t) exp(-xDawson(i)^2 * t) .* t.^m ./ sqrt(1-t), 0, 1) * xDawson(i)^(2*m+1) / 2;
%         end
        if m == 0
            w_m_sum(k) = sum(yDawson .* exp(-alpha(k).*(n - nu(k)))); % Pre-computed x^exp_wm / 2 * integral(@(t) exp(-x^2 * t) .* t.^m ./ sqrt(1-t), 0, 1), done in generateDawsonTable.m, -50 is 1e-50 (start table), and 1000 is points / decade
        elseif m == 1
            w_m_sum(k) = sum(yDawson .* exp(-alpha(k).*(n - nu(k)))); % Pre-computed x^exp_wm / 2 * integral(@(t) exp(-x^2 * t) .* t.^m ./ sqrt(1-t), 0, 1), done in generateDawsonTable.m, -50 is 1e-50 (start table), and 1000 is points / decade
        else
            error('Dawson integral was not yet pre-computed for m > 1.');
        end
        disp(['Computed  ', num2str(k), ' points over ', num2str(length(time_list))])
    elseif strcmp(approx_or_exact, 'approx')
        if m == 0
            w_m_sum(k) = sum(dawson0(round((log10(xDawson)+50)*100), 2)' .* exp(-alpha(k).*(n - nu(k))), 2); % Pre-computed x^exp_wm / 2 * integral(@(t) exp(-x^2 * t) .* t.^m ./ sqrt(1-t), 0, 1), done in generateDawsonTable.m, -50 is 1e-50 (start table), and 1000 is points / decade
        elseif m == 1
            w_m_sum(k) = sum(dawson1(round((log10(xDawson)+50)*100), 2)' .* exp(-alpha(k).*(n - nu(k))), 2); % Pre-computed x^exp_wm / 2 * integral(@(t) exp(-x^2 * t) .* t.^m ./ sqrt(1-t), 0, 1), done in generateDawsonTable.m, -50 is 1e-50 (start table), and 1000 is points / decade
        else
            error('Dawson integral was not yet pre-computed for m > 1.');
        end
    else
        error('approx_or_exact should be either ''exact'' either ''approx'', it cannot be %s', approx_or_exact)        
    end
end

Am      = 4 * kGamma.^2 ./ (sqrt(3*pi) * factorial(m) * (1 + kGamma.^2) ) .* w_m_sum;
w_PPT   = c_nl .* f_lm * Ip .* CC .* (1 + kGamma.^2).^exp_gamma2 .* ...
            Am .* exp(pref_g_exp ./ F_0 .* gGamma) .* ...
            CA / 2.418884326505e-17; % Conversion atomic units to ionizations / second
